import React from 'react';
import { Chart } from "react-google-charts";

const data = [
  ["Day", "Sales"],
  ["Monday", 1200],
  ["Tuesday", 1100],
  ["Wednesday", 1450],
  ["Thursday", 1300],
  ["Friday", 1650],
  ["Saturday", 950],
  ["Sunday", 1250],
];

const options = {
  title: "Recent Registrations or Kuan Recent Admin Account Created",
  curveType: "function", // Smooth the lines
  hAxis: {
    title: "Month",
  },
  vAxis: {
    title: "Registrations",
  },
  legend: { position: "bottom" },
  colors: ["#1A56DB"], // Customize the color of the line
};

const LineChart = ({data,title,}) => {
  return (
    <div>
      <Chart
        chartType="LineChart"
        width="100%"
        height="400px"
        data={data}
        options={options}
        loader={<div>Loading Chart...</div>}
      />
    </div>
  );
};

export default LineChart;
